import React from "react";
import "./styles.scss";

export const Coffeebay = () => {
  let orders = ["order 1", "order 2", "order 3"];
  let listItems = orders.map((orders) => {
    return <li>{orders}</li>;
  });

  return (
    <div className="body">
      <h1>COFFEEBAY</h1>
      <div className="orderlist">
        <ul>{listItems}</ul>
        <form className="form">
          <input
            name="order"
            type="text"
            className="input"
            placeholder="Order name"
          ></input>
          <div>
            <button className="button" type="submit">ADD ORDER</button>
          </div>
        </form>
      </div>
    </div>
  );
};
